import React from 'react';
import { BrowserRouter as Router, Switch, Route,} from 'react-router-dom';
import { compose } from 'redux';


import './App.css';

import Login from './components/login_screen/login_screen';
import Reset from './components/reset_password_screen/reset_password_screen'
import Playlists from './components/Playlists/Playlists'
import Playlist from './components/Playlist/Playlist'
import Home from "./components/HomePage/Home";
import HomeScreen from "./components/home_screen/home_screen"
import Search from "./components/search_screen/Search"
//import mockData from "./mock_data.json"

// const users = mockData.users
// const playlists = mockData.playlists

// console.log(users)

// function findUser(id){
//   for (let i = 0; i < users.length; i++){
//     if (users[i].user_id === id)
//       return users[i]
//   }
// }

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/' exact component={Home} />
        <Route path='/sign-up' component={Login} />
        <Route path='/sign-in' component={Login} />
        <Route path='/forgotpassword' component={Reset}/>
        <Route path='/:userid/playlists/:playlistid' component={Playlist}/> 
        <Route path='/:userid/playlists' component={Playlists}/>
        <Route path='/home-screen' component={HomeScreen} />
        <Route path='/search' component={Search} />
        <Route path='/:any' component={HomeScreen} />
      </Switch>
    </Router>
  );
}

export default App;
